from unittest import TestCase

import time

from parsing.hoa_parser import hoa_to_transitions
from parsing.string_to_program_with_action_guards import string_to_program
from analysis.abstraction.effects_abstraction.effects_abstraction import EffectsAbstraction
from synthesis.abstract_ltl_synthesis_problem import AbstractLTLSynthesisProblem
from synthesis.mealy_machine import MealyMachine
from prop_lang.variable import Variable


class Test(TestCase):
    def test_parse_hoa(self):
        program_pred_props = ["pred__crprev_LT_cr_", "pred__crprev_GT_cr_", "pred__clprev_GT_cl_", "pred__cr_LT__EQ_0_",
                              "pred__cl_LT__EQ_0_", "pred__clprev_LT_cl_", "pred__cr_LT__EQ_1_", "pred__cl_LT__EQ_1_",
                              "q1", "q0"]
        program_pred_props = [Variable(v) for v in program_pred_props]
        program_out_props = ["empty_r", "empty_l", "error", "danger"]
        program_out_props = [Variable(v) for v in program_out_props]
        pure_env_props = ["l2r", "exit_r", "exit_l", "entry_r", "entry_l"]
        pure_env_props = [Variable(v) for v in pure_env_props]
        con_props = ["stop_r","stop_l"]
        con_props = [Variable(v) for v in con_props]

        abstract_synthesis_problem = AbstractLTLSynthesisProblem(pure_env_props,
                                                                 program_out_props,
                                                                 program_pred_props,
                                                                 con_props,
                                                                 assumptions=[],
                                                                 guarantees=[])
        date_file = open("../examples/parallel/road/program.prog", "r").read()
        program = string_to_program(date_file)

        abstraction = EffectsAbstraction(program)

        if "UNREALIZABLE" in strix_output_example:
            counterstrategy = True
        else:
            counterstrategy = False

        start = time.time()
        # logger.info("Parsing Strix output..")
        init_st, trans = hoa_to_transitions(strix_output_example)
        # logger.info("Finished parsing Strix output.. Constructing expanded Mealy Machine now..")
        print(time.time() - start)

        env_props = (abstract_synthesis_problem.get_env_props()
                     + abstract_synthesis_problem.get_program_out_props()
                     + abstract_synthesis_problem.get_program_pred_props())

        con_props = abstract_synthesis_problem.get_con_props()

        mon = MealyMachine("counterstrategy" if counterstrategy else "controller", init_st,
                            env_props,
                            con_props,
                            {},
                            {})

        start = time.time()
        mon.add_transitions_env_con_separate(not counterstrategy,
                                             trans,
                                             abstract_synthesis_problem,
                                             abstraction)
        print(time.time() - start)

        self.assertTrue(True)

